  input: '"TEXT","F3XA","","There is currently a discrepancy between the actual bank
    balance of AmSouth PAC and the balance that has been reported to the FEC.  The
    amount noted as ''Bank Correction'' on Schedule B (line 29) reflects the current
    differnce in the balances of the report and the acutal account.  There are a number
    of factors that have contributed to this error, and they have occured over a number
    of years.  Most of the discrepancy can be accounted for in checks that were entered
    into our software system, but failed to show up on the report that was generated.  A
    large majority of these checks were to state and local candidates.  The following
    federal checks were never reported.  7-31-00, The Southern Tribute Fund, $1,000.  2-22-01,
