    the original check was not.  3-30-01, Tallachie Creek PAC, $1,500.  4-2-01, Leadership
    PAC, $1,000.  4-18-01, Tallachie Creek PAC, $1,000.  5-14-01, Tallachie Creek
    PAC, $1,000.  Also, three checks were reported to the FEC that have never cleared
    the account:  10-4-00, Alan Bense Campaign, $500; 10-4-00, Gaston Cantens Campaign,
    $500; and 10-3-01, Charles Bronson Campaign, $500.  As I noted above, most of
    the other checks that were not reported were for state and local candidates.  This
